'''Fishmongers''' are men who [[Fremennik Fishmonger|sell fish]] in the [[Fremennik]] area. At level 42 [[Thieving]], players may also steal from one of his three nearby stalls full of [[fish]] to receive 42 Thieving [[experience]] and either a [[raw salmon]], [[Raw tuna|tuna]], or occasionally a [[Raw lobster|lobster]]. The stall replenishes approximately every 10 seconds.

Players wishing to train Thieving easily may pickpocket [[Fremennik citizen]]s at level 45 Thieving and then steal fish from the nearby stalls and cook them in the great hall to eat when their health gets low. After stealing from his stall, you can't sell back to him for a little bit (15–20 minutes).

